import "../itemListFolder/item.css"
import { Link } from "react-router-dom"
import StarIcon from '@mui/icons-material/Star';
import StarBorderIcon from '@mui/icons-material/StarBorder';

const Item = ({name, price,id, image, rating }) => {
    console.log(rating)
    return(

    <div className="card" >
        <div>
            {<img className="image"src={image} alt="" />}
        </div>
        <div className="infoCard">
            <h3 className="nameOfItem">{name}</h3>
            <div>
                {rating >= 1 ? <StarIcon/> : <StarBorderIcon/>}
                {rating >= 2 ? <StarIcon/> : <StarBorderIcon/>}
                {rating >= 3 ? <StarIcon/> : <StarBorderIcon/>}
                {rating >= 4 ? <StarIcon/> : <StarBorderIcon/>}
                {rating >= 5 ? <StarIcon/> : <StarBorderIcon/>}
            </div>
            <h3 className="priceOfItem">${price}</h3>
        </div>
        <div className="detailButtonCard" >
            <Link to={`/products/${id}`}> <button className="buttonCard3"> Ver detalles de producto </button> </Link> 
        </div>
    </div>  
    )
}

export default Item
